import z3

p = z3.Int("p")
ks = [z3.Int("k1"), z3.Int("k2"), z3.Int("k3"), z3.Int("k4"), z3.Int("k5")]

count = 0

def nextPrime(a):
    global count
    count += 1
    return a + ks[count - 1]

q = nextPrime(nextPrime(17*p + 1) + 3)
r = nextPrime(29*p*q)
s = nextPrime(q*r + p)
t = nextPrime(r*s*q)

